(function () {
    'use strict';

    // Your code here...
    /* 段落注释
    屏蔽弹出alert模态窗 确保脚本完整运行
    http://1.1.1.3/ac_portal/default/pc.html 存在0.0.0.0走192.168.125.254时会弹出alert模态窗
    alert模态窗内容
    1.1.1.3 显示
    无法获取修改密码强度信息，网络异常
    */
    window.alert = function(){return false}; //屏蔽弹出alert模态窗
    //定义download函数 下载断网判断文件
    function download(filename, text) {
        var element = document.createElement('a');
        element.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(text));
        element.setAttribute('download', filename);
        element.style.display = 'none';
        document.body.appendChild(element);
        element.click();
        document.body.removeChild(element);
    }
    //浏览器标签设置
    const changeFavicon = link => {
        let $favicon = document.querySelector('link[rel="icon"]');
        //如果元素<link rel="icon">已经存在，将$favicon的href更改为link，否则，创建新元素并将其附加到<head>
        if ($favicon !== null) {
            $favicon.href = link;
        } else {
            $favicon = document.createElement("link");
            $favicon.rel = "icon";
            $favicon.href = link;
            document.head.appendChild($favicon);
        }
    };
    //修改网站标签图标 未登录HIS
    changeFavicon('data:image/x-icon;base64,');
    document.title = '药学中心';//修改网站标签标题
    //match的4个页面操作
    if (window.location.href == "http://1.1.1.3/%E8%B6%85%E7%BA%A7%E8%B4%A6%E6%88%B7" || window.location.href == "http://1.1.1.3/1") {//定制URL页面与简易URL页面
        //醒目画面
        document.body.bgColor = "black"
        document.getElementsByTagName('h1')[0].innerHTML = "药学中心";
        document.getElementsByTagName('h1')[0].setAttribute('style', 'color:red;');
        document.getElementsByTagName('center')[1].innerHTML = "药学人员自动登录系统";
        document.getElementsByTagName('center')[1].setAttribute('style', 'color:white;');
        //重启浏览器时进入自定义的URL会404 Not Found——进行重定向
        setTimeout(() => {
            window.location.href = 'http://1.1.1.3/ac_portal/default/pc.html';
        }, 2000);
    } else if (window.location.href == "http://1.1.1.3/ac_portal/default/pc.html") {//登录页面
        //醒目画面
        document.getElementsByClassName('txt_default')[2].innerHTML = "";//避免账号文字重叠
        document.getElementsByClassName('txt_default')[3].innerHTML = "";//避免密码文字重叠
        document.getElementsByClassName('tabs-ul-top_text')[0].innerHTML = "药学中心";
        document.getElementsByClassName('tabs-ul-top_text')[0].setAttribute('style', 'color:red;font-size:35px;');
        document.getElementsByTagName('dd')[2].innerHTML = "药学人员自动登录";
        document.getElementsByTagName('dd')[2].setAttribute('style', 'color:rgb(128,0,255);font-size:25px;');
        //自动登录
        document.querySelector("#rememberPwd").checked = true;//勾选记住登录状态依然记不住
        document.querySelector("#password_name").value = "5007";//账号
        document.querySelector("#password_pwd").value = "88528852";//密码
        document.querySelector("#password_submitBtn").click();//单击登录按钮
        //未成功登录时屏蔽弹出的alert模态窗后触发
        setTimeout(() => {
            download("connect.txt","当前存在0.0.0.0 mask 0.0.0.0 192.168.125.254，需删除。"); //通过download函数下载connect.txt文件供浏览器外的后台.vbs检测网络连接情况
        }, 5000);
        //定时执行循环 浏览器内修复网络异常
        setInterval(() => {
            document.querySelector("#password_submitBtn").click();//单击登录按钮
        }, 10000);
    } else {//成功页面
        //醒目画面
        //修改网站标签图标 已登录KFYY
        changeFavicon('data:image/x-icon;base64,');
        history.pushState(null, null, "/超级账户");//不刷新页面修改浏览器URL——改成定制URL
        //url——base64背景图片 opacity——主体透明度 给通过停留页面设置壁纸
        document.title = '成功登录';//修改网站通过页面标签标题——指向显示无需打开便于判断
        document.body.style = "opacity: 0.4;background: url(data:image/jpeg;base64,);"
        document.getElementsByTagName('div')[124].setAttribute('style', 'width:64px;height:64px;background-Image:url(data:image/x-icon;base64,);');
        document.getElementsByTagName('dd')[21].innerHTML = "<span>登录药学中心</span>用户：<b id=\"logout_name\">5007</b>，您已通过上网认证！";
        document.getElementsByTagName('dd')[21].setAttribute('style', 'color:rgb(128,0,255);font-size:20px;');
        document.getElementsByTagName('span')[8].innerHTML = "登录药学中心";//覆盖<span>登录药学中心</span>
        document.getElementsByTagName('span')[8].setAttribute('style', 'color:rgb(255,0,0);font-size:30px;');
        document.getElementsByTagName('b')[0].innerHTML = "药师";//覆盖<b id=\"logout_name\">5007</b>
        document.getElementsByTagName('b')[0].setAttribute('style', 'color:rgb(0,0,255);font-size:20px;');
        //指定返回登录页
        setTimeout(() => {
            window.location.href = 'http://1.1.1.3/ac_portal/default/pc.html';
        }, 60000);
    }
})();